INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (33232, 1593, 'Bisoprolol', 'Liver Diseases', 'Bisoprolol is eliminated by both the kidney and liver.  Patients with renal and/or liver disease may be at greater risk for adverse effects from bisoprolol due to decreased drug clearance.  Initial dosage adjustments and cautious titration are recommended in patients with a creatinine clearance below 40 mL/min and/or liver disease.', '3', '', 'DDInter', 0);
